Checked absolute value.
Checks for overflow and returns [`None`] if
The result cannot be zero.

# Example

```
# use std::num::NonZero;
#
# fn main() { test().unwrap(); }
# fn test() -> Option<()> {

assert_eq!(Some(pos), neg.checked_abs());
assert_eq!(None, min.checked_abs());
# Some(())
# }
```
